import * as React from "react"
import { View } from "react-native"
import { spacing } from "../../theme"
import { NameChip } from "../name-chip/name-chip"


export interface NameChipIconGroupProps {
    containerSize: number,
    names: string[],
}

export function NameChipIconGroup(props: NameChipIconGroupProps) {
    const { containerSize, names } = props

    let chipList = []

    names.forEach((name) => {
        chipList.push(<View style={{margin: spacing[1]}}><NameChip name={name} /></View>);
    });

    return (
        <View style={{ width: containerSize, height: containerSize, display: 'flex' }}>
            {chipList}
        </View>

    )
}
